import React from "react";

import 'AddExpenseForm.css';
import Card from "../Card";

const AddExpenseForm = () => {
  return (
    <Card className="main-form">
      <button type="button">Add Expense</button>
    </Card>
  );
};

export default AddExpenseForm;
